import json as js

contract_data = {
    'quest1': {
        'data': '',
        'description': 'Deploy a testnet'
    },

    'quest2': {
        'data': '',
        'description': 'Control Structures'
    },

    'quest3': {
        'data': '',
        'description': 'Storage in solidity'
    },

    'quest4': {
        'data': '',
        'description': 'Arrays in solidity'
    },

    'quest5': {
        'data': '',
        'description': 'The mapping type'
    },

    'quest6': {
        'data': '',
        'description': 'Structs'
    },

    'quest8': {
        'data': '',
        'description': 'Imports'
    },

    'quest9': {
        'data': '',
        'description': 'Errors'
    },

    'quest10': {
        'data': '',
        'description': 'The new keyword'
    },

    'quest11': {
        'data': '',
        'description': 'Minimal Tokens Exercise'
    }

}

ABI_PATHS = {
    'quest7': './abi/abi-quest7/abi.txt',
    'quest12': './abi/abi-quest12/abi.txt',
    'quest13': './abi/abi-quest13/abi.txt'
}
BYTECODE_PATHS = {
    'quest7': './abi/abi-quest7/bytecode.txt',
    'quest12': './abi/abi-quest12/bytecode.txt',
    'quest13': './abi/abi-quest13/bytecode.txt'
}

CHAIN_ID = 84532


class CreateContract(Wallet):
    def __init__(self, private_key, number):
        super().__init__(private_key, 'Sepolia-Base', number)
        self.abis = {quest: js.load(open(path)) for quest, path in ABI_PATHS.items()}
        self.bytecodes = {quest: open(path).read() for quest, path in BYTECODE_PATHS.items()}

    @staticmethod
    def generate_random_string(length: int) -> str:
        characters = string.ascii_letters
        return ''.join(random.choice(characters) for _ in range(length))

    def build_transaction(self, data: str, description: str) -> str:
        tx = {
            'chainId': CHAIN_ID,
            'from': self.address_wallet,
            'data': data,
            'nonce': self.web3.eth.get_transaction_count(self.address_wallet),
            **self.get_gas_price()
        }
        tx['gas'] = self.web3.eth.estimate_gas(tx)
        tx_hash = self.send_transaction_and_wait(tx, f'{description} create complete')
        return tx_hash

    @exception_handler('')
    def create(self, quest: str) -> Union[str, None]:
        logger.info(f'Start {quest}\n')

        if quest not in ['quest7', 'quest12', 'quest13']:
            data = contract_data[quest]['data']
            description = contract_data[quest]['description']
            return self.build_transaction(data, description)

        if quest == 'quest7':
            return self.create_quest7()
        if quest == 'quest12':
            return self.create_erc_contract('quest12', 'ERC-20 token')
        if quest == 'quest13':
            return self.create_erc_contract('quest13', 'ERC-721 token')

    def create_quest7(self) -> str:
        logger.info(f'Start quests 7/1\n')

        # Salesperson contract creation
        salesperson_tx_data = ''
        tx_hash = self.build_transaction(salesperson_tx_data, 'Salesperson create')
        salesperson = self.get_contract_address(tx_hash)

        sleeping(TIME_DELAY[0], TIME_DELAY[1])

        logger.info(f'Start quests 7/2\n')

        # Manager contract creation
        manager_tx_data = ''
        tx_hash = self.build_transaction(manager_tx_data, 'Manager create')
        manager = self.get_contract_address(tx_hash)

        sleeping(TIME_DELAY[0], TIME_DELAY[1])
        logger.info(f'Start quests 7/3\n')

        # Inheritance Exercise contract creation
        contract = self.web3.eth.contract(abi=self.abis['quest7'], bytecode=self.bytecodes['quest7'])
        tx = contract.constructor(salesperson, manager).build_transaction({
            'from': self.address_wallet,
            'nonce': self.web3.eth.get_transaction_count(self.address_wallet),
            **self.get_gas_price()
        })
        tx_hash = self.send_transaction_and_wait(tx, 'Inheritance Exercise create complete')
        return tx_hash

    def create_erc_contract(self, quest: str, token_type: str) -> str:
        logger.info(f'Start {token_type} create\n')

        contract = self.web3.eth.contract(abi=self.abis[quest], bytecode=self.bytecodes[quest])
        name = self.generate_random_string(random.randint(6, 8)).lower()
        symbol = name[:3]
        tx = contract.constructor(name, symbol).build_transaction({
            'from': self.address_wallet,
            'nonce': self.web3.eth.get_transaction_count(self.address_wallet),
            **self.get_gas_price()
        })
        tx_hash = self.send_transaction_and_wait(tx, f'{token_type} create complete')
        return tx_hash
